// 等待 CryptoJS 加载完成
function waitForCryptoJS() {
    return new Promise((resolve) => {
        if (window.CryptoJS) {
            resolve(window.CryptoJS);
        } else {
            const checkInterval = setInterval(() => {
                if (window.CryptoJS) {
                    clearInterval(checkInterval);
                    resolve(window.CryptoJS);
                }
            }, 100);
        }
    });
}

// 使用 AES 加密算法
async function decrypt(encryptedText, key) {
    const CryptoJS = await waitForCryptoJS();
    try {
        const decrypted = CryptoJS.AES.decrypt(encryptedText, key);
        return decrypted.toString(CryptoJS.enc.Utf8);
    } catch (e) {
        console.error('解密失败');
        return '';
    }
}

// 检查页面上是否有加密内容并尝试解密
async function checkAndDecrypt() {
    const encryptedElements = document.querySelectorAll('.encrypted-content');
    if (!encryptedElements.length) return;

    const key = localStorage.getItem('blog-key') || prompt('请输入解密密码：');
    if (!key) return;

    for (const element of encryptedElements) {
        const encryptedText = element.getAttribute('data-content');
        const decryptedText = await decrypt(encryptedText, key);
        
        if (decryptedText) {
            localStorage.setItem('blog-key', key); // 保存密码
            element.innerHTML = decryptedText;
        }
    }
}

// 页面加载时执行解密
document.addEventListener('DOMContentLoaded', checkAndDecrypt);

// 对于使用 Astro view transitions 的情况，需要在页面切换后也执行解密
document.addEventListener('astro:after-swap', checkAndDecrypt);